import React, { Component } from 'react';
import NavBar from '../components/NavBar/NavBar';
import img from '../assets/images/homebuyer.jpeg';

class Home extends Component {
  render() {
    return (
      <div>
        <NavBar />
        <img src={img} alt="" />
        <h1>Hello World</h1>
      </div>
    )
  }
}

export default Home;
